import styled from 'styled-components';

export const MainBox = ({score, qrCode, materials, manufacturing, use, transport, endOfLife}) =>{
    return (
        <Container>
            <Column>
                <div>{score}</div>
                <div>kg CO2E</div>
                <div>{qrCode}</div>
            </Column>
            <Column>
                <div>Materials {materials}</div>
                <div>Manufacturing {manufacturing}</div>
                <div>Use {use}</div>
                <div>Transport {transport}</div>
                <div>End of Life {endOfLife}</div>
            </Column>
        </Container>
    );
};

export default MainBox;

const Container = styled.div`
    border-radius: 5px;
    border: 2px solid black;
    display: flex;
    flex-direction: row;
    padding: 10px;
`;

